import React from 'react';
import headerStyles from './HeaderStyles';

const Header = () => {
  return (
    <header style={headerStyles.header}>
      <div className="logo-thumb" style={headerStyles.logoThumb}></div>
      <div className="menu" style={headerStyles.menu}>
        <nav>
          <ul className="site-nav" style={headerStyles.siteNav}>
            <li className="site-nav__item" style={headerStyles.siteNavItem}>
              <a className="site-nav__link" style={headerStyles.siteNavLink} href="/">Home</a>
            </li>
            <li className="site-nav__item" style={headerStyles.siteNavItem}>
              <a className="site-nav__link" style={headerStyles.siteNavLink} href="/goods">Goods</a>
            </li>
          </ul>
        </nav>
      </div>
    </header>
  );
}

export default Header;
